import React from 'react';
import { Link } from 'react-router-dom';

const MenuItem = ({ itemName, itemType, itemId, quantity }) => {
  return (
    <div>
      <p>
        <Link to={`/${itemType}/${itemId}`}>
          {itemName} {quantity && `(Quantity: ${quantity})`}
        </Link>
      </p>
    </div>
  );
};

export default MenuItem;
